def f(x):
    while x % 2 == 0:
        x //= 2
    return x

def solve():
    from collections import defaultdict
    import sys
    input = sys.stdin.read
    data = input().split()
    n = int(data[0])
    a = list(map(int, data[1:n+1]))

    total = 0
    count = defaultdict(int)

    for num in a:
        count[num] += 1

    for i in range(n):
        for j in range(i, n):
            total += f(a[i] + a[j])

    print(total)

solve()

